import React from 'react';
import "./Content.css";
import Kurt from "./asset/MaskGroup.png";
import Liam from "./asset/liam.png";
import Alex from "./asset/alex.png";
import Nuno from "./asset/nuno.png";
import DeleteImage from "./asset/delete.png"

const Card = props => {
    const { nama, perawatan, jam, image, imageDelete} = props;
    return(
        <div className="CardContainer">
            <div className="DeleteContainer">
            <img className="Delete" src = {imageDelete}/>
            </div>
            <div className="FotodanNama">
                <img className="Foto2" src = {image} />

                <div className="Nama">
                    <div className="Atas">{nama}</div>
                    <div className="Bawah">{perawatan}</div>
                </div>
            </div>

            <div className="CheckOrCancelContainer">
                <div className="JamJadwal">{jam}</div>

                <div className="CnC">
                    <div className="btnCheck">Finish</div>
                    <div className="btnCancel">Cancel</div>
                </div>
            </div>

            <div className="DetailsContainer">
                <div className="btnDetails">View details</div>
            </div>

        </div>



    );



};


const CardContainers = () =>{
    return(
        <div className="CardContainer1">

                <Card
                imageDelete = {DeleteImage} 
                image={Kurt}
                nama="Nandhika"
                perawatan="Kontrol Gigi"
                jam="12:00"
            ></Card>

            <Card 
            imageDelete = {DeleteImage}
                image={Liam}
                nama="Pratama"
                perawatan="Kontrol Behel"
                jam="13:00"
            ></Card>


            <Card 
            imageDelete = {DeleteImage}
                image={Alex}
                nama="Putra"
                perawatan="Ganti Karet"
                jam="14:00"
            ></Card>


            <Card 
            imageDelete = {DeleteImage}
                image={Nuno}
                nama="Nesia"
                perawatan="Tambel gigi"
                jam="15:00"
            ></Card>

        </div>




    );

}


export default CardContainers;
